import React from 'react';
import { Link } from 'react-router-dom';
import Header from './Header';
import Footer from './Footer';
import styles from './Nav.module.css'


function Nav() {

  return (
    <div className={`${styles.nav} nav`}>
      <Header type='nav'></Header>
      <ul className={styles.gnbList}>
        <li>
          <Link onClick={() => setCurrentOn('214')} to='/twice/profile'>PROFILE</Link>
        </li>
        <li>
          <Link to='/twice/discography'>DISCOGRAPHY</Link>
        </li>
        <li>
          <Link to='/twice/gallery'>GALLERY</Link>
        </li>
        <li>
          <Link to='/twice/video'>VIDEO</Link>
        </li>
      </ul>
      <Footer type='black'></Footer>
    </div>
  );
}

export default Nav;
